import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import {BrowserRouter} from 'react-router-dom';

const route = ReactDOM.createRoot(document.getElementById('root'));

route.render(
  <BrowserRouter>
  <App/>
  </BrowserRouter>
)
